// Create About component here to display the a small content here.
// In this component use paragraph tag (p) to display the content

import { Component } from "react";

export default class About extends Component {
  render() {
    return (
      <p>
        Hi, my name is Bhavya Sree. I am a full stack developer and I have
        developed several projects with MERN stack. I am also familiar with Java
        and SpringBoot
      </p>
    );
  }
}
